import React, { useState } from 'react';
import './List.css';

const List = (props) => {
  const { listItems } = props;

  return (
    <div>
      {listItems.map((item) => (
        <button className="todoItem" key={item.key}>
          {item.title}
        </button>
      ))}
    </div>
  );
};

export default List;
